namespace RonSijm.FluidHumidifier.Factories.OSIS;

public class PipelineFactory(string resourceName = null, Action<Humidifier.OSIS.Pipeline> factoryAction = null) : ResourceFactory<Humidifier.OSIS.Pipeline>(resourceName)
{

    internal InnerPipelineBufferOptionsFactory BufferOptionsFactory { get; set; }

    internal InnerPipelineVpcOptionsFactory VpcOptionsFactory { get; set; }

    internal InnerPipelineLogPublishingOptionsFactory LogPublishingOptionsFactory { get; set; }

    internal InnerPipelineEncryptionAtRestOptionsFactory EncryptionAtRestOptionsFactory { get; set; }

    protected override Humidifier.OSIS.Pipeline Create()
    {
        var pipelineResult = CreatePipeline();
        factoryAction?.Invoke(pipelineResult);

        return pipelineResult;
    }

    private Humidifier.OSIS.Pipeline CreatePipeline()
    {
        var pipelineResult = new Humidifier.OSIS.Pipeline
        {
            GivenName = InputResourceName,
        };

        return pipelineResult;
    }
    public override void CreateChildren(Humidifier.OSIS.Pipeline result)
    {
        base.CreateChildren(result);

        result.BufferOptions ??= BufferOptionsFactory?.Build();
        result.VpcOptions ??= VpcOptionsFactory?.Build();
        result.LogPublishingOptions ??= LogPublishingOptionsFactory?.Build();
        result.EncryptionAtRestOptions ??= EncryptionAtRestOptionsFactory?.Build();
    }

} // End Of Class

